-- ----------------------------
-- Table structure for fa_business
-- ----------------------------
DROP TABLE IF EXISTS `fa_business`;
CREATE TABLE `fa_business`  (
  `id` int UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '主键',
  `mobile` varchar(11) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '手机号',
  `nickname` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '昵称',
  `password` varchar(150) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '密码',
  `salt` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '密码盐',
  `avatar` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '' COMMENT '头像',
  `gender` enum('0','1','2') CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '0' COMMENT '性别 0保密，1男，2女',
  `sourceid` int UNSIGNED NULL DEFAULT NULL COMMENT '来源外键id',
  `deal` enum('0','1') CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '0' COMMENT '0 未成交\r\n1 已成交',
  `openid` varchar(190) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT 'openid',
  `province` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '省',
  `city` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '市',
  `district` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '区',
  `adminid` int UNSIGNED NULL DEFAULT NULL COMMENT '申请管理员id',
  `createtime` int NULL DEFAULT NULL COMMENT '创建时间',
  `deletetime` int NULL DEFAULT NULL COMMENT '回收站',
  `money` decimal(10, 2) UNSIGNED NULL DEFAULT 0.00 COMMENT '余额',
  `email` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '邮箱',
  `auth` enum('0','1') CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '0' COMMENT '认证 0 未认证 1已认证',
  `point` decimal(10, 2) UNSIGNED NULL DEFAULT 0.00 COMMENT '积分',
  `motto` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '个性签名',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `key_business_mobile`(`mobile` ASC) USING BTREE,
  UNIQUE INDEX `key_business_openid`(`openid` ASC) USING BTREE,
  INDEX `key_business_sourceid`(`sourceid` ASC) USING BTREE,
  INDEX `key_business_adminid`(`adminid` ASC) USING BTREE,
  CONSTRAINT `fk_business_adminid` FOREIGN KEY (`adminid`) REFERENCES `fa_admin` (`id`) ON DELETE SET NULL ON UPDATE RESTRICT,
  CONSTRAINT `fk_business_sourceid` FOREIGN KEY (`sourceid`) REFERENCES `fa_business_source` (`id`) ON DELETE SET NULL ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 61 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '客户表' ROW_FORMAT = COMPACT;

