DROP TABLE IF EXISTS `fa_depot_back`;
CREATE TABLE `fa_depot_back`  (
  `id` int UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '主键',
  `code` varchar(150) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '单据编号-自动生成',
  `ordercode` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '订单编号',
  `busid` int UNSIGNED NULL DEFAULT NULL COMMENT '客户外键',
