  `phone` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '联系电话',
  `address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '详细地址',
  `province` int UNSIGNED NULL DEFAULT NULL COMMENT '省',
  `city` int UNSIGNED NULL DEFAULT NULL COMMENT '市',
  `district` int UNSIGNED NULL DEFAULT NULL COMMENT '区',
  `amount` decimal(10, 2) UNSIGNED NULL DEFAULT 0.00 COMMENT '总价',
  `expressid` int UNSIGNED NULL DEFAULT NULL COMMENT '物流公司外键',
  `expresscode` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '物流单号',
  `createtime` int UNSIGNED NULL DEFAULT NULL COMMENT '创建时间',
  `remark` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '备注',
  `status` enum('0','1','2','3','-1') CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT '0' COMMENT '0：未审核\r\n1：已审核，未收货\r\n2：已收货，未入库\r\n3：已入库，生成入库单记录\r\n-1：审核不通过',
  `reason` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '作废理由',
  `adminid` int UNSIGNED NULL DEFAULT NULL COMMENT '销售员',
  `reviewerid` int UNSIGNED NULL DEFAULT NULL COMMENT '审核员',
  `stromanid` int UNSIGNED NULL DEFAULT NULL COMMENT '仓管员入库',
  `storageid` int UNSIGNED NULL DEFAULT NULL COMMENT '入库外键',
  `thumbs` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '退货图集',
  `deletetime` int UNSIGNED NULL DEFAULT NULL COMMENT '软删除字段',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `key_depot_back_code`(`code` ASC) USING BTREE,
  UNIQUE INDEX `key_depot_back_ordercode`(`ordercode` ASC) USING BTREE,
  UNIQUE INDEX `key_depot_back_expresscode`(`expresscode` ASC) USING BTREE,
  INDEX `key_depot_back_busid`(`busid` ASC) USING BTREE,
  INDEX `key_depot_back_expressid`(`expressid` ASC) USING BTREE,
  INDEX `key_depot_back_adminid`(`adminid` ASC) USING BTREE,
  INDEX `key_depot_back_reviewerid`(`reviewerid` ASC) USING BTREE,
  INDEX `key_depot_back_stromanid`(`stromanid` ASC) USING BTREE,
  INDEX `key_depot_back_storageid`(`storageid` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 12 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '退货表' ROW_FORMAT = DYNAMIC;

