INSERT INTO `fa_admin_log` VALUES (2465, 1, 'admin', '/erp.php/subject/subject/add?dialog=1', '云课堂 / 课程管理 / 添加', '{\"dialog\":\"1\",\"row\":{\"cateid\":\"28\",\"title\":\"PHP 编程入门\",\"price\":\"99\",\"content\":\"实验任务通过一个简单例子熟悉 PHP 运行方式学习 PHP 标记、指令分隔符和注释学习 PHP 数据类型：基本数据类型、字符串定义学习 PHP 数据类型：数组、对象、Resource 及 NULLPHP 的变量的类型、定义和命名规则常量定义与魔术常量PHP 的运算符在程序中的使用PHP 的控制结构（一）：if、while、for、foreach、break 等PHP 的控制结构（二）：continue、switch、declare、include 等PHP 定义普通函数、可变函数、引用函数、匿名函数PHP 类和对象（一）：类的定义、继承、构造和析构函数等PHP 类和对象（二）：Static 关键字、抽象类、接口等先学知识需要了解蓝桥云课的基本操作，推荐学习&amp;nbsp;新手入门指南。课程难度本课程难度为简单。面向用户本课程为 PHP 语言的基本使用入门，面向没有经验的新手，适合所有想要学习编程和想要在蓝桥云课学习的人。\",\"thumbs\":\"\\/uploads\\/20231213\\/e1356d8c964a6c3e1ae8b0f0ccf24716.png\"}}', '27.46.235.246', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/118.0.0.0 Safari/537.36', 1702475304);
