INSERT INTO `fa_admin_log` VALUES (2467, 1, 'admin', '/erp.php/subject/subject/add?dialog=1', '云课堂 / 课程管理 / 添加', '{\"dialog\":\"1\",\"row\":{\"cateid\":\"28\",\"title\":\"PHP 开发一个 MVC 框架\",\"price\":\"120\",\"content\":\"在 PHP 开发的世界里，有许许多多优秀的框架帮助开发者快速创建一个 Web 工程，其中 MVC 框架以其简明的逻辑、易维护特性、人性化的开发流程成为框架设计理念的主流。课程中用到了容器，依赖注入，分发器，类自动加载，命名空间等知识点。通过学习这些知识，可以加深你对 Laravel、Yii 等使用了依赖注入思想的框架的理解。我们将你平时在使用框架过程中遇到的一些似是而非的疑惑，进行大刀阔斧的拆解，呈现给你框架内部最核心的逻辑。在开发过程中，涉及大量的字符串操作、魔术方法的使用、路由、控制器、视图等内容。丰富的代码量，可以加深你对整个开发流程的熟悉程度，同时也让你对 PHP 中的一些基本操作，如魔术方法，类自动加载器，字符串处理更加熟练。可以说，阅读一个开源项目的源码对程序员的影响是巨大的，那么开发一个框架就是一个程序员的质变。本训练营对一个完整的 MVC 框架进行细致剖析，实现了读与做的双管齐下，无论你是萌新还是大佬，都能从本课程中学习或者加深对程序设计的理解。在今后的学习当中，当更容易突破学习瓶颈，游刃有余地使用 MVC 模式进行开发。适合人群学习本训练营需要具备 PHP 语法基础知识、对 MVC 开发基础概念有初步认识。先学课程若有过以下学习经验，将会获得更好的学习效果。PHP 编程入门Laravel 5.1 框架基础课程信息学习周期：课程有效期 2 个月，2 个月后无法进行在线实验，但可查看文档内容。高级会员有效期内可一直学习，到期后课程失效，且无法查看文档。部分云主机实验环境因成本较高，存在开启次数限制。关于课程退款等相关注意事项说明，请阅读&amp;nbsp;用户付费协议。版权说明：课程内容为蓝桥云课原创或蓝桥云课在原作者授权下制作。未经书面同意，擅自爬取、转载和再分发课程内容，均将受到严肃追责。\",\"thumbs\":\"\\/uploads\\/20231213\\/d6f53025e10a74ad7b9cb3b9f4c28af9.png\"}}', '27.46.235.246', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/118.0.0.0 Safari/537.36', 1702476166);
