INSERT INTO `fa_admin_log` VALUES (2469, 1, 'admin', '/erp.php/subject/subject/add?dialog=1', '云课堂 / 课程管理 / 添加', '{\"dialog\":\"1\",\"row\":{\"cateid\":\"28\",\"title\":\"PHP Socket 编程基础入门\",\"price\":\"150\",\"content\":\"你将学到的&amp;nbsp;TCP 协议&amp;nbsp;PHP Socket 函数&amp;nbsp;多进程编程&amp;nbsp;I\\/O 多路复用技术&amp;nbsp;进程通信&amp;nbsp;守护进程详细介绍实验任务学习 TCP 协议的基本工作流程：创建、拆除、状态转换利用 Socket 去实现简易的网络编程模块改写代码实现处理更高的并发连接通过 I\\/O 复用进一步提高程序处理并发的能力将所写普通的进程转换为守护进程结合之前的实验内容实现一个比较完整的 Web 服务器先学知识需要了解蓝桥云课的基本操作，推荐学习&amp;nbsp;新手入门指南；如果你没有接触过 PHP 编程语言，推荐学习&amp;nbsp;PHP 编程入门。课程难度本课程难度为中等。面向用户本课程为 PHP 网络编程的入门课程，面向有一定 PHP 编程经验的用户。\",\"thumbs\":\"\\/uploads\\/20231213\\/d44a46f6349c822297942e7041ce303f.png\"}}', '27.46.235.246', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/118.0.0.0 Safari/537.36', 1702476331);
