INSERT INTO `fa_admin_log` VALUES (2473, 1, 'admin', '/erp.php/subject/subject/add?dialog=1', '云课堂 / 课程管理 / 添加', '{\"dialog\":\"1\",\"row\":{\"cateid\":\"28\",\"title\":\"基于 Swoole 开发 Web 框架\",\"price\":\"200\",\"content\":\"你将学到的&amp;nbsp;PHP 并发编程&amp;nbsp;Swoole 协程 API 使用及源码剖析&amp;nbsp;Composer 的安装及使用&amp;nbsp;PHP 扩展的安装及启用&amp;nbsp;依赖注入&amp;nbsp;请求与响应&amp;nbsp;路由&amp;nbsp;环境变量&amp;nbsp;控制器与模板引擎&amp;nbsp;Session&amp;nbsp;ORM&amp;nbsp;Inotify 监控文件及服务自启详细介绍Swoole 是当前国内最受欢迎的 PHP 扩展之一，提供了强大的并发编程支持，很多大厂如腾讯等都在核心业务中大规模使用 Swoole。Swoole 已经成为新时代 PHPER 的必备技能，而能否熟练掌握 Swoole ，也似乎也越来越成了初中级 PHPER 与高级 PHPER 的分水岭。在层出不穷的 Swoole 框架中，其实没有本质上的区别，无论它们的官网宣称有多强大，其底层依然离不开 Swoole API 和 Composer 库的支持，而在本课程中，我会抽丝剥茧地把框架展现给你看，从零去开发一个框架，其流程是通用的，包括框架的组织架构，框架与项目如何分离等。学习了本课程，相信无论是开发基于 Swoole 的框架，还是传统的 php-fpm 框架，你都能游刃有余。本课程前几章会介绍 PHP 并发编程的演变历史，从源码层面去剖析 Swoole 的一些 API，让你对这些 API 有更加深刻的认识。后几章会手把手教你如何去从零开始设计一个框架，在设计过程中会穿插一些原理的讲解，让读者知其然，更要知其所以然。无论以后 Swoole 框架如何迭代，读者都可以轻松对其进行剖析，使用，以及更改。课程特色注重原理的讲解，让读者的基础更加牢靠，在以后职场上走得更远。课程巨细无遗，即便你没有过多的 PHP 编程经验，也能让你在实验中没有任何障碍。课程有深度，亦有广度，不会浅尝辄止，深入剖析源代码，把所有的技术细节都展现给读者。先学课程了解蓝桥云课的基本操作，推荐学习&amp;nbsp;新手入门指南课程难度本课程难度为中等。面向用户本课程面向 PHP 初、中级程序员，有一定编程经验想深入了解 Swoole 的朋友。课程信息学习周期：课程有效期 2 个月，2 个月后无法进行在线实验，但可查看文档内容。高级会员有效期内可一直学习，到期后课程失效，且无法查看文档。部分云主机实验环境因成本较高，存在开启次数限制。关于课程退款等相关注意事项说明，请阅读&amp;nbsp;用户付费协议。版权说明：课程内容为蓝桥云课原创或蓝桥云课在原作者授权下制作。未经书面同意，擅自爬取、转载和再分发课程内容，均将受到严肃追责。\",\"thumbs\":\"\\/uploads\\/20231213\\/81287602bab3da4006f5cd08ffc5ac86.png\"}}', '27.46.235.246', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/118.0.0.0 Safari/537.36', 1702476713);
