INSERT INTO `fa_admin_log` VALUES (2476, 1, 'admin', '/erp.php/subject/subject/add?dialog=1', '云课堂 / 课程管理 / 添加', '{\"dialog\":\"1\",\"row\":{\"cateid\":\"29\",\"title\":\"Python 异步网络编程实战\",\"price\":\"99\",\"content\":\"你将学到的&amp;nbsp;协程的概念&amp;nbsp;Socket 编程&amp;nbsp;I\\/O 模型&amp;nbsp;I\\/O 多路复用&amp;nbsp;异步爬虫&amp;nbsp;greenlet 使用&amp;nbsp;gevent 使用详细介绍近年来 Python 的发展的非常迅速，“简单”、“高效”是 Python 吸引人的一大特色。在国内 Python 开发需求越来越大，Python 具有丰富强大的库，现在各个领域都在广泛使用，从 Web 开发，到运维开发，到机器学习，到人工智能，Python 都有广泛的应用。学习 Python 几乎可以做任何事情，对自己的编程技能会有很大的提升。Python 是一种解释性语言，语法简单易用，上手较快，代码优雅。Python 的开发效率很高，也是大多数开发选择 Python 的原因。但是 Python 的一个缺点就是性能比较差，对于 Web 开发，性能是比较重要的指标。而在解决性能方面，Python 出现了一些第三方异步网络框架，如 Tornado，Twisted，Gevent，是比较流行异步框架。在 Python 官方也正式推出了 Asyncio 库，在这个库上面也出现了大量的 Web 框架。性能方面有了很大的提升。对于做 Web 开发的人员来说，可能会用到一些异步框架，但是不理解里面的实现原理。本课程讲解 Python 异步实现，从简单的原理开始讲解，其中会涉及到很多的知识点，协程，Socket，异步 I\\/O，爬虫，会跟着一个一个的实验，慢慢实现一个性能强大的爬虫。通过本课程的学习，不仅仅是让你掌握基本的 Python 异步开发，同时会了解其中的实现原理，并且会接触到 Python 字节码，协程，Socket 编程，Liunx I\\/O 模型，爬虫实现，Gevent 原理。你将会接触到很多的知识点，对于自己的知识面提升有很大的帮助。在以后的开发中，不仅知道实现的方法，还能知道实现的原理，这样才能更快的开发出健壮的应用。本训练课程共分为 8 个部分。第一部分是对 Python 协程的讲解，从字节码开始简单讲解了 Python 虚拟机的执行过程，可以大体了解到 Python 协程的执行过程。第二部分是 Python 中 CS 架构的概念讲解和套接字 Socket 的基本用途。第三部分介绍了 Linux 下的五种 I\\/O 模型，并且使用 Python 的 select 模块提供的接口，实现 Select，Poll，Epoll 这三种模型的服务端。 这三部分分别介绍了 Python 中的协程，Socket，异步 I\\/O ，介绍的知识点比较多，能够对基础知识有较深的理解 第四，五，六部分，讲解的网络爬虫，从简单的同步方法，到异步方法，最后结合协程，实现了一个即性能高又实现简单的爬虫。从简单到复杂，一步一个实现，最后完成一个性能强大的爬虫，整个的讲解比较清晰，能先循渐进的理解整个实现过程 第七，八部分讲解了 greenlet 实现协程，和 gevent 的大体结构实现。这里可以了解 gevent 的大体实现过程，对于 gevent 的执行过程有个大体的了解。课程特色本课程知识点较多，学习过程中，需要有一定的 Python 基础需要具有 Python 网络编程基础和爬虫基础本课程结构比较清晰，按照从易到难，循序渐进讲解整个实现过程学习后可以提升大家对于知识的理解和掌握，在以后的开发中能有更加深入的理解适合人群从事 Python Web 开发的技术人员对 Python 感兴趣，想了解 Python 异步实现过程在开发过程中，想使用异步方式提升 Python 性能的开发者\",\"thumbs\":\"\\/uploads\\/20231213\\/b78ed1f545ac7161d5346e2e43d6abbe.png\"}}', '27.46.235.246', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/118.0.0.0 Safari/537.36', 1702476931);
