INSERT INTO `fa_admin_log` VALUES (2478, 1, 'admin', '/erp.php/subject/subject/add?dialog=1', '云课堂 / 课程管理 / 添加', '{\"dialog\":\"1\",\"row\":{\"cateid\":\"29\",\"title\":\"Python 数据分析入门实战\",\"price\":\"79\",\"content\":\"你将学到的&amp;nbsp;Python 基础语法&amp;nbsp;NumPy&amp;amp;Pandas 基础知识&amp;nbsp;二维图形绘制&amp;nbsp;子图及组合图形&amp;nbsp;兼容 MATLAB 风格的 API&amp;nbsp;数据读取与处理&amp;nbsp;分类问题算法&amp;nbsp;聚类算法&amp;nbsp;数据可视化&amp;nbsp;中文分词&amp;nbsp;Word2Vec 方法&amp;nbsp;决策树分类&amp;nbsp;朴素贝叶斯&amp;nbsp;人工神经网络详细介绍本训练营中，我们将学习怎么样使用 Python 进行数据分析。课程将从数据分析基础开始，一步步深入讲解。从 Python 的基础用法到数据分析的各种算法，并结合各种实例，讲解数据分析过程中的方方面面。课程内容将分为以下四个部分：第一部分：介绍了 Python 基本用法以及几个重要的数据分析包如 NumPy 和 Pandas。第二部分：介绍了数据的准备过程，如数据清洗，异常值处理，可视化等。第三部分：介绍了数据建模内容，如假设和检验，分类与预测，聚类分析等。第四部分：各种数据分析实例，这些实将综合运用之前几节的各种内容，使用具体的算法如 KNN，K-Means 等解决实际问题。适合人群具有一定 Python 基础，对数据分析有兴趣想要学习的同学。\",\"thumbs\":\"\\/uploads\\/20231213\\/50e79755985c50decc7fdc471a908ef3.png\"}}', '27.46.235.246', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/118.0.0.0 Safari/537.36', 1702477140);
