INSERT INTO `fa_admin_log` VALUES (2487, 1, 'admin', '/erp.php/subject/subject/add?dialog=1', '云课堂 / 课程管理 / 添加', '{\"dialog\":\"1\",\"row\":{\"cateid\":\"30\",\"title\":\"C++ 基础入门实战\",\"price\":\"129\",\"content\":\"你将学到的&amp;nbsp;C++ 语言概述&amp;nbsp;C++ 语言的输入输出&amp;nbsp;扩展名和注释符&amp;nbsp;基本数据类型&amp;nbsp;变量与常量&amp;nbsp;运算符和表达式&amp;nbsp;基本控制结构&amp;nbsp;函数定义与使用&amp;nbsp;类和对象的定义&amp;nbsp;数组的使用和初始化&amp;nbsp;指针的声明和使用&amp;nbsp;指针和引用的区别详细介绍C 语言最初是贝尔实验室的 Dennis Ritchie 在 B 语言的基础上开发出来的。C 语言具有运算符和数据结构丰富、语言简洁灵活、程序执行效率高等系列优点，被市场广泛应用。但 C 语言终究是面向过程的编程语言，与其他面向过程的编程语言一样，无法满足运用面向对象方法的开发需求。而 C++ 语言便是在优化 C 语言的基础上为支持面向对象的程序设计而研制的一个通用目的的程序设计语言。在后来的持续研究中，C++ 增加了许多新概念，例如虚函数、重载、继承、标准模板库、异常处理、命名空间等。C++ 语言的特点主要表现在两个方面： 全面兼容 C 语言 和 支持面向对象的方法。由于 C++ 可以全面兼容 C，这就使得部分由 C 语言编写的代码在未经修改的情况下就可以为 C++ 所用，这极大的促进了 C++ 的普及和面向对象技术的广泛应用。C++ 最具有意义的一面就是支持面向对象的方法。与 C 兼容的特点虽赋予 C++ 双重特点，但 C 和 C++ 在概念上却是两种完全不同的程序设计语言，所以在 C++ 中应注意按照面向对象的思维去编写代码。此外，C++ 在保持 C 简洁、高效等特点的基础上，对 C 的类型系统进行改革和扩充，因此 C++ 编译环境能检测出的类型错误更多。先学课程新手指南之玩转蓝桥云课WebIDE 环境使用指南深入学习C++ 进阶应用实战\",\"thumbs\":\"\\/uploads\\/20231213\\/2e5b8e30467c96d4c3f90af11523f2bc.png\"}}', '27.46.235.246', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/118.0.0.0 Safari/537.36', 1702477717);
