INSERT INTO `fa_admin_log` VALUES (2489, 1, 'admin', '/erp.php/subject/subject/add?dialog=1', '云课堂 / 课程管理 / 添加', '{\"dialog\":\"1\",\"row\":{\"cateid\":\"30\",\"title\":\"C++ 从零实现 NoSQL 数据库\",\"price\":\"89\",\"content\":\"你将学到的&amp;nbsp;C++ 11 核心语法的实际运用&amp;nbsp;使用 C++ 11 网络库编写服务程序&amp;nbsp;理解 Qedis 数据结构模型&amp;nbsp;理解 Qedis 命令分发及命令逻辑实现&amp;nbsp;理解 Qedis 事务与乐观锁&amp;nbsp;理解发布订阅实现&amp;nbsp;学习使用 Leveldb 并与 Qedis 结合详细介绍本课程使用 C++ 11 从头实现一个完全兼容 redis 的 kv 数据库项目——Qedis，支持 linux 和 mac os；该项目会使用到一些 C++ 11 的核心特性和 STL 库，并利用一个 reactor 模式的 tcp 网络库，逐步构建出一个完全兼容 Redis 的更高性能的内存数据库。Qedis 和 Redis 是 100% 兼容的，它实现了 Redis2.6 所有功能，因此在课程中也经常混用 Qedis 和 Redis 这两个词，我们不必在意他们的区别。欢迎学习课程的同学，加入学习讨论群，一起沟通，同时群内作者也会不定时进行答疑回复。效果展示启动 Qedis 服务器使用 Redis 官方客户端访问刚才启动 Qedis 服务器先学课程Redis 基础教程适合人群本课程难度覆盖较广，包括初级、中级、高级，用户可以根据自己目前的水平慢慢学习；读者最好有一定的 C++基础，并了解 Redis，有 Redis 使用经验更佳。\",\"thumbs\":\"\\/uploads\\/20231213\\/f56b027e91ea5204715fc33916a1c726.png\"}}', '27.46.235.246', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/118.0.0.0 Safari/537.36', 1702477848);
