INSERT INTO `fa_admin_log` VALUES (2516, 1, 'admin', '/erp.php/subject/subject/add?dialog=1', '云课堂 / 课程管理 / 添加', '{\"dialog\":\"1\",\"row\":{\"cateid\":\"33\",\"title\":\"Spring Cloud 与 Docker 实战\",\"price\":\"129\",\"content\":\"你将学到的&amp;nbsp;Spring Cloud 特点&amp;nbsp;Eureka 使用&amp;nbsp;为服务消费者整合 Ribbon&amp;nbsp;消费者整合 Feign&amp;nbsp;Hystrix 实现容错&amp;nbsp;配置 Zuul 网关&amp;nbsp;使用 Spring Cloud Config&amp;nbsp;Spring Cloud Sleuth 简介&amp;nbsp;Zipkin 的使用&amp;nbsp;Docker 安装及常用命令&amp;nbsp;Docker 镜像构建&amp;nbsp;Docker Registry 与 Maven 构建镜像&amp;nbsp;Docker Compose 编排文件编写&amp;nbsp;通过 Docker Compose 编排启动微服务详细介绍什么是微服务？它解决了哪些问题？它又具有哪些特征呢？关于一些微服务理论性的内容在网上基本都有了，因此本课程主要讲解如何通过实验的方式实战 Spring Boot\\/Cloud 并结合 Docker 使用。课程包含了服务注册于发现中心 Eureka、Spring Boot Actuator 监控端点、Ribbon 客户端负载均衡、Feign 声明式 REST 调用、 Hystrix 容错处理、Zuul 网关、Spring Cloud Config 配置管理、Spring Cloud Sleuth 与 Zipkin 结合图形化展示、Docker 与 Docker Compose 的基本使用，最后通过 Dcoker Compose 介绍了接近实际开发的两个例子。本训练营课程共分为 15 个部分。课程首先会介绍一下微服务架构和 Spring Cloud 相关概念。接着就开始基于 Spring Cloud 开始实战编写微服务，从 Eureka 服务注册与发现到后面的 Docker 运行微服务。最后结合 Docker Compose 编排多个 Docekr 容器。课程特色Spring Cloud 是开发分布式系统的「全家桶」，是一系列框架的有序集合。Spring Cloud 利用 Spring Boot 的开发便利性巧妙地简化了分布式系统基础设施的开发。Spring Cloud 对于中小型互联网公司来说是一种福音，使用 Spring Cloud 一站式解决方案能在从容应对业务发展的同时大大减少开发成本。这套 Spring Cloud 入门教程在讲解 Spring Cloud 自身内容的同时也深入分享了一些实战中的问题、解决思路以及扩展内容，适用于 Java 开发人员，特别是对微服务架构感兴趣的开发人员阅读学习。效果展示eurekazipkin适合人群适用于 Java 开发人员，特别是对微服务架构感兴趣的开发人员阅读学习。\",\"thumbs\":\"\\/uploads\\/20231213\\/8c0fbf27ffd323638783e1bc409b386b.png\"}}', '27.46.235.246', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/118.0.0.0 Safari/537.36', 1702479853);
