INSERT INTO `fa_admin_log` VALUES (2522, 1, 'admin', '/erp.php/subject/subject/add?dialog=1', '云课堂 / 课程管理 / 添加', '{\"dialog\":\"1\",\"row\":{\"cateid\":\"35\",\"title\":\"Git 与 GitHub 入门实践\",\"price\":\"59\",\"content\":\"你将学到的&amp;nbsp;Git 与 GitHub 的来历&amp;nbsp;在 GitHub 上创建仓库&amp;nbsp;安装 Git&amp;nbsp;克隆 GitHub 上的仓库到本地&amp;nbsp;Git 仓库的三大区域&amp;nbsp;添加修改到暂存区以及撤销修改&amp;nbsp;查看提交历史&amp;nbsp;配置个人信息&amp;nbsp;版本回退&amp;nbsp;处理 commit 时间线分叉&amp;nbsp;添加 SSH 关联授权&amp;nbsp;为 Git 命令设置别名&amp;nbsp;创建新的本地分支&amp;nbsp;本地分支跟踪远程分支&amp;nbsp;忽略文件&amp;nbsp;什么是 PR&amp;nbsp;同步主仓库&amp;nbsp;Git 标签的作用详细介绍实验任务熟悉 Git 与 GitHub 的来历，在 GitHub 上创建仓库并克隆仓库到本地完成一次完整的项目修改、提交、推送操作为 Git 命令设置别名，掌握分支管理的六个常用操作创建多人协作仓库，邀请合作者，添加 issue完成任务后推送提交并向主仓库提 PR ，合并 PR 后同步主仓库掌握 Git 标签的作用和基本用法先学知识需要了解蓝桥云课的基本操作，推荐学习&amp;nbsp;新手入门指南。课程难度本课程难度为简单。面向用户本课程为 Git &amp;amp; GitHub 的基本使用入门，面向没有经验的新手，如果你希望快速掌握 GitHub 和 Git 的基本操作，为以后的 IT 技术工作打下良好的基础，本课程是非常好的入门选择。\",\"thumbs\":\"\\/uploads\\/20231213\\/dac30ad49d14f97b095d541f66dec9b4.png\"}}', '27.46.235.246', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/118.0.0.0 Safari/537.36', 1702480121);
