INSERT INTO `fa_subject` VALUES (136, 'PHP 编程入门', '实验任务通过一个简单例子熟悉 PHP 运行方式学习 PHP 标记、指令分隔符和注释学习 PHP 数据类型：基本数据类型、字符串定义学习 PHP 数据类型：数组、对象、Resource 及 NULLPHP 的变量的类型、定义和命名规则常量定义与魔术常量PHP 的运算符在程序中的使用PHP 的控制结构（一）：if、while、for、foreach、break 等PHP 的控制结构（二）：continue、switch、declare、include 等PHP 定义普通函数、可变函数、引用函数、匿名函数PHP 类和对象（一）：类的定义、继承、构造和析构函数等PHP 类和对象（二）：Static 关键字、抽象类、接口等先学知识需要了解蓝桥云课的基本操作，推荐学习&nbsp;新手入门指南。课程难度本课程难度为简单。面向用户本课程为 PHP 语言的基本使用入门，面向没有经验的新手，适合所有想要学习编程和想要在蓝桥云课学习的人。', '/uploads/20231213/e1356d8c964a6c3e1ae8b0f0ccf24716.png', NULL, 99.00, 28, 1702475304, NULL);
INSERT INTO `fa_subject` VALUES (137, 'PHP 开发一个 MVC 框架', '在 PHP 开发的世界里，有许许多多优秀的框架帮助开发者快速创建一个 Web 工程，其中 MVC 框架以其简明的逻辑、易维护特性、人性化的开发流程成为框架设计理念的主流。课程中用到了容器，依赖注入，分发器，类自动加载，命名空间等知识点。通过学习这些知识，可以加深你对 Laravel、Yii 等使用了依赖注入思想的框架的理解。我们将你平时在使用框架过程中遇到的一些似是而非的疑惑，进行大刀阔斧的拆解，呈现给你框架内部最核心的逻辑。在开发过程中，涉及大量的字符串操作、魔术方法的使用、路由、控制器、视图等内容。丰富的代码量，可以加深你对整个开发流程的熟悉程度，同时也让你对 PHP 中的一些基本操作，如魔术方法，类自动加载器，字符串处理更加熟练。可以说，阅读一个开源项目的源码对程序员的影响是巨大的，那么开发一个框架就是一个程序员的质变。本训练营对一个完整的 MVC 框架进行细致剖析，实现了读与做的双管齐下，无论你是萌新还是大佬，都能从本课程中学习或者加深对程序设计的理解。在今后的学习当中，当更容易突破学习瓶颈，游刃有余地使用 MVC 模式进行开发。适合人群学习本训练营需要具备 PHP 语法基础知识、对 MVC 开发基础概念有初步认识。先学课程若有过以下学习经验，将会获得更好的学习效果。PHP 编程入门Laravel 5.1 框架基础课程信息学习周期：课程有效期 2 个月，2 个月后无法进行在线实验，但可查看文档内容。高级会员有效期内可一直学习，到期后课程失效，且无法查看文档。部分云主机实验环境因成本较高，存在开启次数限制。关于课程退款等相关注意事项说明，请阅读&nbsp;用户付费协议。版权说明：课程内容为蓝桥云课原创或蓝桥云课在原作者授权下制作。未经书面同意，擅自爬取、转载和再分发课程内容，均将受到严肃追责。', '/uploads/20231213/d6f53025e10a74ad7b9cb3b9f4c28af9.png', NULL, 120.00, 28, 1702476166, NULL);
INSERT INTO `fa_subject` VALUES (138, 'PHP Socket 编程基础入门', '你将学到的&nbsp;TCP 协议&nbsp;PHP Socket 函数&nbsp;多进程编程&nbsp;I/O 多路复用技术&nbsp;进程通信&nbsp;守护进程详细介绍实验任务学习 TCP 协议的基本工作流程：创建、拆除、状态转换利用 Socket 去实现简易的网络编程模块改写代码实现处理更高的并发连接通过 I/O 复用进一步提高程序处理并发的能力将所写普通的进程转换为守护进程结合之前的实验内容实现一个比较完整的 Web 服务器先学知识需要了解蓝桥云课的基本操作，推荐学习&nbsp;新手入门指南；如果你没有接触过 PHP 编程语言，推荐学习&nbsp;PHP 编程入门。课程难度本课程难度为中等。面向用户本课程为 PHP 网络编程的入门课程，面向有一定 PHP 编程经验的用户。', '/uploads/20231213/d44a46f6349c822297942e7041ce303f.png', NULL, 150.00, 28, 1702476331, NULL);
INSERT INTO `fa_subject` VALUES (139, 'PHP 基础入门实战', '你将学到的&nbsp;PHP 基本语法&nbsp;PHP 数据类型&nbsp;PHP 变量&nbsp;PHP 常量&nbsp;PHP 运算符&nbsp;PHP 流程控制&nbsp;PHP 函数&nbsp;PHP 类与对象&nbsp;MySQL 基本操作&nbsp;PHP 操作 MySQL 实例详细介绍本课程是 PHP 基础入门实战课程，课程先从对 PHP 的基本介绍一直到基本语法、数据类型、运算符、控制结构、函数、类与对象。然后学习 MySQL 的常用命令，并学会如何使用 PHP 操作 MySQL。先学课程HTML5 简明教程MySQL 基础课程课程难度简单适合人群有 HTML 基本使用的基础，了解 MySQL 的学员。课程信息学习周期：课程有效期 2 个月，2 个月后无法进行在线实验，但可查看文档内容。高级会员有效期内可一直学习，到期后课程失效，且无法查看文档。部分云主机实验环境因成本较高，存在开启次数限制。关于课程退款等相关注意事项说明，请阅读&nbsp;用户付费协议。版权说明：课程内容为蓝桥云课原创或蓝桥云课在原作者授权下制作。未经书面同意，擅自爬取、转载和再分发课程内容，均将受到严肃追责。', '/uploads/20231213/695c27a979730138164b4a8ef0d93ea3.png', NULL, 89.00, 28, 1702476524, NULL);
INSERT INTO `fa_subject` VALUES (140, '基于 Swoole 开发 Web 框架', '你将学到的&nbsp;PHP 并发编程&nbsp;Swoole 协程 API 使用及源码剖析&nbsp;Composer 的安装及使用&nbsp;PHP 扩展的安装及启用&nbsp;依赖注入&nbsp;请求与响应&nbsp;路由&nbsp;环境变量&nbsp;控制器与模板引擎&nbsp;Session&nbsp;ORM&nbsp;Inotify 监控文件及服务自启详细介绍Swoole 是当前国内最受欢迎的 PHP 扩展之一，提供了强大的并发编程支持，很多大厂如腾讯等都在核心业务中大规模使用 Swoole。Swoole 已经成为新时代 PHPER 的必备技能，而能否熟练掌握 Swoole ，也似乎也越来越成了初中级 PHPER 与高级 PHPER 的分水岭。在层出不穷的 Swoole 框架中，其实没有本质上的区别，无论它们的官网宣称有多强大，其底层依然离不开 Swoole API 和 Composer 库的支持，而在本课程中，我会抽丝剥茧地把框架展现给你看，从零去开发一个框架，其流程是通用的，包括框架的组织架构，框架与项目如何分离等。学习了本课程，相信无论是开发基于 Swoole 的框架，还是传统的 php-fpm 框架，你都能游刃有余。本课程前几章会介绍 PHP 并发编程的演变历史，从源码层面去剖析 Swoole 的一些 API，让你对这些 API 有更加深刻的认识。后几章会手把手教你如何去从零开始设计一个框架，在设计过程中会穿插一些原理的讲解，让读者知其然，更要知其所以然。无论以后 Swoole 框架如何迭代，读者都可以轻松对其进行剖析，使用，以及更改。课程特色注重原理的讲解，让读者的基础更加牢靠，在以后职场上走得更远。课程巨细无遗，即便你没有过多的 PHP 编程经验，也能让你在实验中没有任何障碍。课程有深度，亦有广度，不会浅尝辄止，深入剖析源代码，把所有的技术细节都展现给读者。先学课程了解蓝桥云课的基本操作，推荐学习&nbsp;新手入门指南课程难度本课程难度为中等。面向用户本课程面向 PHP 初、中级程序员，有一定编程经验想深入了解 Swoole 的朋友。课程信息学习周期：课程有效期 2 个月，2 个月后无法进行在线实验，但可查看文档内容。高级会员有效期内可一直学习，到期后课程失效，且无法查看文档。部分云主机实验环境因成本较高，存在开启次数限制。关于课程退款等相关注意事项说明，请阅读&nbsp;用户付费协议。版权说明：课程内容为蓝桥云课原创或蓝桥云课在原作者授权下制作。未经书面同意，擅自爬取、转载和再分发课程内容，均将受到严肃追责。', '/uploads/20231213/81287602bab3da4006f5cd08ffc5ac86.png', NULL, 200.00, 28, 1702476713, NULL);
INSERT INTO `fa_subject` VALUES (141, 'Python 异步网络编程实战', '你将学到的&nbsp;协程的概念&nbsp;Socket 编程&nbsp;I/O 模型&nbsp;I/O 多路复用&nbsp;异步爬虫&nbsp;greenlet 使用&nbsp;gevent 使用详细介绍近年来 Python 的发展的非常迅速，“简单”、“高效”是 Python 吸引人的一大特色。在国内 Python 开发需求越来越大，Python 具有丰富强大的库，现在各个领域都在广泛使用，从 Web 开发，到运维开发，到机器学习，到人工智能，Python 都有广泛的应用。学习 Python 几乎可以做任何事情，对自己的编程技能会有很大的提升。Python 是一种解释性语言，语法简单易用，上手较快，代码优雅。Python 的开发效率很高，也是大多数开发选择 Python 的原因。但是 Python 的一个缺点就是性能比较差，对于 Web 开发，性能是比较重要的指标。而在解决性能方面，Python 出现了一些第三方异步网络框架，如 Tornado，Twisted，Gevent，是比较流行异步框架。在 Python 官方也正式推出了 Asyncio 库，在这个库上面也出现了大量的 Web 框架。性能方面有了很大的提升。对于做 Web 开发的人员来说，可能会用到一些异步框架，但是不理解里面的实现原理。本课程讲解 Python 异步实现，从简单的原理开始讲解，其中会涉及到很多的知识点，协程，Socket，异步 I/O，爬虫，会跟着一个一个的实验，慢慢实现一个性能强大的爬虫。通过本课程的学习，不仅仅是让你掌握基本的 Python 异步开发，同时会了解其中的实现原理，并且会接触到 Python 字节码，协程，Socket 编程，Liunx I/O 模型，爬虫实现，Gevent 原理。你将会接触到很多的知识点，对于自己的知识面提升有很大的帮助。在以后的开发中，不仅知道实现的方法，还能知道实现的原理，这样才能更快的开发出健壮的应用。本训练课程共分为 8 个部分。第一部分是对 Python 协程的讲解，从字节码开始简单讲解了 Python 虚拟机的执行过程，可以大体了解到 Python 协程的执行过程。第二部分是 Python 中 CS 架构的概念讲解和套接字 Socket 的基本用途。第三部分介绍了 Linux 下的五种 I/O 模型，并且使用 Python 的 select 模块提供的接口，实现 Select，Poll，Epoll 这三种模型的服务端。 这三部分分别介绍了 Python 中的协程，Socket，异步 I/O ，介绍的知识点比较多，能够对基础知识有较深的理解 第四，五，六部分，讲解的网络爬虫，从简单的同步方法，到异步方法，最后结合协程，实现了一个即性能高又实现简单的爬虫。从简单到复杂，一步一个实现，最后完成一个性能强大的爬虫，整个的讲解比较清晰，能先循渐进的理解整个实现过程 第七，八部分讲解了 greenlet 实现协程，和 gevent 的大体结构实现。这里可以了解 gevent 的大体实现过程，对于 gevent 的执行过程有个大体的了解。课程特色本课程知识点较多，学习过程中，需要有一定的 Python 基础需要具有 Python 网络编程基础和爬虫基础本课程结构比较清晰，按照从易到难，循序渐进讲解整个实现过程学习后可以提升大家对于知识的理解和掌握，在以后的开发中能有更加深入的理解适合人群从事 Python Web 开发的技术人员对 Python 感兴趣，想了解 Python 异步实现过程在开发过程中，想使用异步方式提升 Python 性能的开发者', '/uploads/20231213/b78ed1f545ac7161d5346e2e43d6abbe.png', NULL, 99.00, 29, 1702476931, NULL);
INSERT INTO `fa_subject` VALUES (142, 'Python 数据分析入门实战', '你将学到的&nbsp;Python 基础语法&nbsp;NumPy&amp;Pandas 基础知识&nbsp;二维图形绘制&nbsp;子图及组合图形&nbsp;兼容 MATLAB 风格的 API&nbsp;数据读取与处理&nbsp;分类问题算法&nbsp;聚类算法&nbsp;数据可视化&nbsp;中文分词&nbsp;Word2Vec 方法&nbsp;决策树分类&nbsp;朴素贝叶斯&nbsp;人工神经网络详细介绍本训练营中，我们将学习怎么样使用 Python 进行数据分析。课程将从数据分析基础开始，一步步深入讲解。从 Python 的基础用法到数据分析的各种算法，并结合各种实例，讲解数据分析过程中的方方面面。课程内容将分为以下四个部分：第一部分：介绍了 Python 基本用法以及几个重要的数据分析包如 NumPy 和 Pandas。第二部分：介绍了数据的准备过程，如数据清洗，异常值处理，可视化等。第三部分：介绍了数据建模内容，如假设和检验，分类与预测，聚类分析等。第四部分：各种数据分析实例，这些实将综合运用之前几节的各种内容，使用具体的算法如 KNN，K-Means 等解决实际问题。适合人群具有一定 Python 基础，对数据分析有兴趣想要学习的同学。', '/uploads/20231213/50e79755985c50decc7fdc471a908ef3.png', NULL, 79.00, 29, 1702477140, NULL);
INSERT INTO `fa_subject` VALUES (143, 'NumPy 数值计算基础入门', '你将学到的&nbsp;NumPy 基本操作详细介绍实验任务了解 NumPy 数值类型与数据结构使用 NumPy 对数组进行运算使用 NumPy 对数组进行切片使用 NumPy 对数组形状进行操作使用 NumPy 对数组进行统计先学知识需要了解蓝桥云课的基本操作，推荐学习&nbsp;新手入门指南。课程难度本课程难度为简单。面向用户本课程主要讲解 NumPy 的基本操作；该课程适合于对数据分析感兴趣，或者想要使用 Python 进行数据分析的用户。', '/uploads/20231213/fcd15fde2be5130713f241585eff23c0.png', NULL, 89.00, 29, 1702477371, NULL);
INSERT INTO `fa_subject` VALUES (144, 'TensorBoard 深度学习可视化实践', '你将学到的&nbsp;TensorBoard 安装&nbsp;TensorBoard 使用&nbsp;深度学习训练可视化&nbsp;深度学习样本可视化详细介绍课程介绍TensorBoard 是 TensorFlow 提供的一款可视化工具，其专门针对深度学习训练过程存在的可视化需求设计。本次实验中，我们将了解 TensorBoard 的功能组件和基础使用方法。先学课程TensorFlow 深度学习基础课程课程难度容易适合人群深度学习初学者', '/uploads/20231213/4c2779816f54ebca380fb93d0b9d3b78.png', NULL, 109.00, 29, 1702477450, NULL);
INSERT INTO `fa_subject` VALUES (145, 'Python 实现图片转字符画', '你将学到的&nbsp;Linux 命令行操作&nbsp;Python 基础&nbsp;pillow 库的使用&nbsp;argparse 库的使用详细介绍实验任务安装 pillow 库实现处理命令行参数的代码实现 RGB 值转字符的函数实现处理图片的代码下载图片并使用程序实现图片转字符画的效果练习题：把小羊图片转变为字符画先学知识最好是先了解基础的 Python 语法，推荐学习Python3 简明教程。课程难度本课程难度为中等。面向用户本课程是使用 Python 来实现图片转字符画，面向已经有 Python 基础同时想要通过一些练手项目进一步提升 Python 编程能力的同学。', '/uploads/20231213/9b06c86f887999d6c6b8acff96a61e39.png', NULL, 89.00, 29, 1702477546, NULL);
INSERT INTO `fa_subject` VALUES (146, 'C++ 基础入门实战', '你将学到的&nbsp;C++ 语言概述&nbsp;C++ 语言的输入输出&nbsp;扩展名和注释符&nbsp;基本数据类型&nbsp;变量与常量&nbsp;运算符和表达式&nbsp;基本控制结构&nbsp;函数定义与使用&nbsp;类和对象的定义&nbsp;数组的使用和初始化&nbsp;指针的声明和使用&nbsp;指针和引用的区别详细介绍C 语言最初是贝尔实验室的 Dennis Ritchie 在 B 语言的基础上开发出来的。C 语言具有运算符和数据结构丰富、语言简洁灵活、程序执行效率高等系列优点，被市场广泛应用。但 C 语言终究是面向过程的编程语言，与其他面向过程的编程语言一样，无法满足运用面向对象方法的开发需求。而 C++ 语言便是在优化 C 语言的基础上为支持面向对象的程序设计而研制的一个通用目的的程序设计语言。在后来的持续研究中，C++ 增加了许多新概念，例如虚函数、重载、继承、标准模板库、异常处理、命名空间等。C++ 语言的特点主要表现在两个方面： 全面兼容 C 语言 和 支持面向对象的方法。由于 C++ 可以全面兼容 C，这就使得部分由 C 语言编写的代码在未经修改的情况下就可以为 C++ 所用，这极大的促进了 C++ 的普及和面向对象技术的广泛应用。C++ 最具有意义的一面就是支持面向对象的方法。与 C 兼容的特点虽赋予 C++ 双重特点，但 C 和 C++ 在概念上却是两种完全不同的程序设计语言，所以在 C++ 中应注意按照面向对象的思维去编写代码。此外，C++ 在保持 C 简洁、高效等特点的基础上，对 C 的类型系统进行改革和扩充，因此 C++ 编译环境能检测出的类型错误更多。先学课程新手指南之玩转蓝桥云课WebIDE 环境使用指南深入学习C++ 进阶应用实战', '/uploads/20231213/2e5b8e30467c96d4c3f90af11523f2bc.png', NULL, 129.00, 30, 1702477717, NULL);
INSERT INTO `fa_subject` VALUES (147, 'C++ 从零实现 NoSQL 数据库', '你将学到的&nbsp;C++ 11 核心语法的实际运用&nbsp;使用 C++ 11 网络库编写服务程序&nbsp;理解 Qedis 数据结构模型&nbsp;理解 Qedis 命令分发及命令逻辑实现&nbsp;理解 Qedis 事务与乐观锁&nbsp;理解发布订阅实现&nbsp;学习使用 Leveldb 并与 Qedis 结合详细介绍本课程使用 C++ 11 从头实现一个完全兼容 redis 的 kv 数据库项目——Qedis，支持 linux 和 mac os；该项目会使用到一些 C++ 11 的核心特性和 STL 库，并利用一个 reactor 模式的 tcp 网络库，逐步构建出一个完全兼容 Redis 的更高性能的内存数据库。Qedis 和 Redis 是 100% 兼容的，它实现了 Redis2.6 所有功能，因此在课程中也经常混用 Qedis 和 Redis 这两个词，我们不必在意他们的区别。欢迎学习课程的同学，加入学习讨论群，一起沟通，同时群内作者也会不定时进行答疑回复。效果展示启动 Qedis 服务器使用 Redis 官方客户端访问刚才启动 Qedis 服务器先学课程Redis 基础教程适合人群本课程难度覆盖较广，包括初级、中级、高级，用户可以根据自己目前的水平慢慢学习；读者最好有一定的 C++基础，并了解 Redis，有 Redis 使用经验更佳。', '/uploads/20231213/f56b027e91ea5204715fc33916a1c726.png', NULL, 89.00, 30, 1702477848, NULL);
INSERT INTO `fa_subject` VALUES (148, 'C++ 实现简易 Docker 容器', '你将学到的&nbsp;Linux Namespace&nbsp;Linux Control Group&nbsp;Linux 系统调用&nbsp;C++ 编程&nbsp;C/C++ 混合编译详细介绍实验任务了解 Namespace 技术和相应的系统调用，使用 Namespace 进行资源隔离使用 Linux 的原生 API 来对网络进行操作了解 Control Group 技术和相应的系统调用，使+ 用 Control Group 限制容器资源先学知识需要了解蓝桥云课的基本操作，推荐学习&nbsp;新手入门指南；如果你没有学习过 C++ 编程语言，推荐学习&nbsp;C 语言入门教程、C++11/14 高速上手教程。课程难度本课程难度为较难。面向用户本课程为 C++ 实战练手项目，面向有一定 C++ 编程基础的同学。', '/uploads/20231213/f0dab968cf0a7b6c6d8055359a829703.png', NULL, 139.00, 30, 1702477971, NULL);
INSERT INTO `fa_subject` VALUES (149, 'C++11&14 高速上手教程', '你将学到的&nbsp;C++11/14 简介&nbsp;auto 类型推导&nbsp;范围 for 迭代&nbsp;初始化列表&nbsp;变参模板&nbsp;Lambda 表达式&nbsp;函数对象容器&nbsp;右值引用&nbsp;无序容器&nbsp;元组&nbsp;智能指针&nbsp;引用计数&nbsp;正则表达式库&nbsp;并发编程&nbsp;noexcept 关键字&nbsp;字面量详细介绍实验任务C++11/14 简介及推荐的进阶阅读资料清单C++11/14 中对语言可用性的增强：auto 类型推导、范围 for 迭代、初始化列表、变参模板C++11/14 中对语言运行期的增强：Lambda 表达式、函数对象容器 std::function、右值引用C++11/14 中对标准库的扩充：std::array、std::forward_list、两组无序容器、元组 std::tupleC++11/14 中对标准库的扩充：智能指针和引用计数C++11/14 中对标准库的扩充：正则表达式库C++11/14 中对标准库的扩充：语言层提供了并发编程的相关支持C++11/14 中其他扩充：新类型 long long int、noexcept 的修饰和操作、字面量C++17 简介：非类型模板参数的 auto、std::variant&lt;&gt;、结构化绑定、变量声明的强化先学知识需要了解蓝桥云课的基本操作，推荐学习&nbsp;新手入门指南；如果你没有学习过任何一门编程语言，推荐学习&nbsp;C 语言入门教程。课程难度本课程难度为中等。面向用户本课程为 C++11/14 的入门课程，适合有 C++ 编程基础、想进一步学习 C++ 的同学。', '/uploads/20231213/ef35e0d86f857e0f20ba21646cc96720.png', NULL, 159.00, 30, 1702478041, NULL);
INSERT INTO `fa_subject` VALUES (150, 'C++ 实现 STL 标准库和算法', '你将学到的&nbsp;STL 的组成部分&nbsp;C++ 泛型编程&nbsp;迭代器&nbsp;函数对象&nbsp;适配器&nbsp;Lambda 表达式&nbsp;STL 常用算法&nbsp;STL 常见的容器&nbsp;位运算&nbsp;异常处理详细介绍实验任务了解 STL 的六个组成部分：容器、迭代器、算法、仿函数、适配器、空间配置器了解 C++ 模板编程（泛型编程）和迭代器学习 5 种常见迭代器：输入、输出迭代器，前向逆向迭代器，双向迭代器和随机迭代器编程实现预定义函数对象并测试学习 Lambda 表达式 和 Algorithm.h 中的常用算法学习 C++11 vector 的构造和成员函数的编写学习 list 的定义及基本操作学习 deque 的定义及基本操作位运算、栈和队列，容器适配的概念set（集合） 和 multiset（多重集） 的区别和构造map 和 multimap 的区别和用法介绍异常的概念和语法规则先学知识需要了解蓝桥云课的基本操作，推荐学习&nbsp;新手入门指南；如果你没有学习过任何编程语言，推荐学习&nbsp;C 语言入门教程。课程难度本课程难度为中等。面向用户本课程为 C++ 的进阶课程，适合有 C++ 编程基础、想进一步学习 C++ 的同学。', '/uploads/20231213/1bba8b65899002e2dda4cf77ce77de3b.png', NULL, 138.00, 30, 1702478162, NULL);
INSERT INTO `fa_subject` VALUES (151, 'MySQL 基础课程', '你将学到的&nbsp;MySQL 简介&nbsp;安装 MySQL&nbsp;创建数据库&nbsp;创建数据表&nbsp;数据类型&nbsp;插入数据&nbsp;约束&nbsp;SELECT 查询&nbsp;删除数据库&nbsp;修改表结构&nbsp;修改表内容&nbsp;索引和视图&nbsp;导入和导出&nbsp;备份和恢复详细介绍先学知识需要了解蓝桥云课的基本操作，推荐学习&nbsp;新手入门指南。课程难度本课程的六个实验为入门实验，难度为简单。面向用户本课程为 MySQL 的基本使用入门。实验面向没有经验的新手，如果你希望快速上手 MySQL，可以学习此部分。', '/uploads/20231213/d0ea8a89ba40cfaf7696b0bfc5565022.png', NULL, 79.00, 31, 1702478936, NULL);
INSERT INTO `fa_subject` VALUES (152, 'MySQL 数据库进阶实战', '你将学到的&nbsp;数据库和表&nbsp;查询操作&nbsp;约束和索引&nbsp;权限管理&nbsp;数据库的事务&nbsp;存储引擎&nbsp;恢复与备份&nbsp;优化方法详细介绍MySQL 是应用广泛的关系数据库。本课程是 MySQL 基础课程的一个提升课，在课程中不会再重复讲解基础知识，重点是放在 MySQL 的一些高级特性上，以及对数据库查询的性能优化。学习完本课程的同学会掌握数据库运维的相关知识，多表联合查询，日志的使用等数据库的进阶知识。先学课程MySQL 基础课程课程难度中等适合人群适合有 MySQL 基础的同学。想要从事运维方面工作的同学。想要进一步了解 MySQL 的同学。', '/uploads/20231213/50f304e04f109e3d87f27770f65db2b0.png', NULL, 99.00, 31, 1702478991, NULL);
INSERT INTO `fa_subject` VALUES (153, 'HTML 实现 Markdown 编辑器', '你将学到的&nbsp;JavaScript 基础知识&nbsp;marked 库的使用&nbsp;ace 库的使用详细介绍实验任务使用 HTML+CSS 完成简单页面布局使用 JavaScript 进行编辑器初始化使用localStorage进行数据的缓存使用highlight.js库实现代码高亮先学知识需要了解蓝桥云课的基本操作，推荐学习&nbsp;新手入门指南。在进行本章实验之前，推荐学习HTML5 基础教程，&nbsp;CSS 基础课程，JavaScript 基础课程。课程难度本课程难度为中等。面向用户本课程打造了一个实时 Markdown 编辑器，并实现了代码高亮效果；该课程适合具有一定的前端基础（HTML+CSS+JavaScript）的用户。', '/uploads/20231213/d7d0772d81ba14991999d5a368772242.jpg', NULL, 59.00, 32, 1702479114, NULL);
INSERT INTO `fa_subject` VALUES (154, 'CSS3 简明教程', '你将学到的&nbsp;CSS 运行基础&nbsp;CSS 基础语法&nbsp;CSS 区块模型&nbsp;CSS 数值与单位&nbsp;CSS 基本样式&nbsp;CSS 选择器&nbsp;CSS 定位&nbsp;CSS 导航&nbsp;CSS 浮动属性&nbsp;CSS3 介绍&nbsp;CSS3 文本和布局&nbsp;CSS3 元素属性的升级&nbsp;CSS3 动画和过渡&nbsp;CSS3 选择器详细介绍先学知识需要了解蓝桥云课的基本操作，推荐学习&nbsp;新手入门指南。课程难度本课程难度为简单。面向用户本课程为 CSS 和 CSS3 的入门课程，面向完全没有经验的新手，但推荐先学习 HTML 基础。', '/uploads/20231213/77483e4910a2b66b28766662cf1080d4.png', NULL, 119.00, 32, 1702479290, NULL);
INSERT INTO `fa_subject` VALUES (155, 'Spring Boot 入门教程', '你将学到的&nbsp;Spring Boot 基础概念&nbsp;手动创建 Spring Boot 项目&nbsp;Spring Boot 中的 starter&nbsp;Spring Boot 配置文件&nbsp;Spring Boot 静态资源&nbsp;Spring Boot MVC 基本配置&nbsp;Spring Boot 事务控制&nbsp;使用 aop 进行事务控制&nbsp;多数据源配置&nbsp;Spring Boot 集成 MyBatis&nbsp;Spring Boot 集成 Redis&nbsp;Spring Boot 集成 RabbitMQ&nbsp;Spring Boot 配置 profile&nbsp;Spring Boot 线上部署详细介绍先学知识需要掌握Java 编程语言基础、MySQL 基础课程、Spring MVC 简易教程。课程难度本课程难度中等。面向用户本次课程是 Spring Boot 入门教程，面向已经熟悉 Spring 和 Spring MVC 开发的同学。', '/uploads/20231213/a6afb037380eaf85c76769434b856257.png', NULL, 109.00, 33, 1702479429, NULL);
INSERT INTO `fa_subject` VALUES (156, 'Java 简明教程', '你将学到的&nbsp;Java 基础概念&nbsp;Java 基础数据类型&nbsp;运算符&nbsp;Java 流程控制语句&nbsp;数组&nbsp;用户输入操作&nbsp;面向对象编程&nbsp;Java 常用类&nbsp;Java 泛型&nbsp;集合框架&nbsp;排序算法&nbsp;异常处理&nbsp;lambda 表达式&nbsp;函数式接口&nbsp;stream 流&nbsp;io 编程&nbsp;网络编程&nbsp;多线程编程&nbsp;JDBC 访问数据库&nbsp;反射&nbsp;正则表达式&nbsp;设计模式详细介绍课程难度本课程难度为简单。面向用户本课程为 Java 的入门课程，面向没有编程基础的同学，如果你希望快速上手 Java 语言，本课程是你非常好的入门选择。', '/uploads/20231213/13ae96a07222d71f8622d47666f2eaab.png', NULL, 89.00, 33, 1702479488, NULL);
INSERT INTO `fa_subject` VALUES (157, 'Spring 框架基础入门', '你将学到的&nbsp;Spring 应用场景&nbsp;Spring 项目创建&nbsp;Spring 配置文件&nbsp;Spring 的松耦合&nbsp;Spring IoC 容器&nbsp;Spring 依赖注入的方法&nbsp;Spring Bean 生命周期&nbsp;Spring 自动扫描与装配&nbsp;Spring 基于注解的配置&nbsp;Spring AOP&nbsp;自动创建 Proxy&nbsp;AspectJ 框架&nbsp;Spring 事务管理&nbsp;Spring MVC 框架详细介绍先学知识需要掌握Java 编程语言基础、MySQL 基础课程和Java Web 服务器与项目管理工具入门课程难度本课程难度稍微有点困难。面向用户本课程为 Spring 框架入门课程，面向有 Java 开发基础，想要深入了解 Java web 开发的同学，学完本次课程过后会对以后的开发打下良好的基础。', '/uploads/20231213/b5f44d6b4ae1b46496ec948f1610424d.png', NULL, 139.00, 33, 1702479617, NULL);
INSERT INTO `fa_subject` VALUES (158, 'Eclipse 实现 Java 编辑器', '你将学到的&nbsp;Java swing 编程&nbsp;io 流操作&nbsp;Runtime 类&nbsp;Thread 的使用详细介绍实验任务新建项目创建包和类GUI 界面的实现测试类的实现actionPerformed 方法的实现run 方法的实现简单测试先学知识需要掌握Java 编程语言基础课程难度本课程难度中等面向用户本课程适合 Java 基础扎实，对 Java 核心 API 有所熟悉的同学学习。', '/uploads/20231213/338c703e28b45b35dcca4f591c347db5.png', NULL, 109.00, 33, 1702479747, NULL);
INSERT INTO `fa_subject` VALUES (159, 'Spring Cloud 与 Docker 实战', '你将学到的&nbsp;Spring Cloud 特点&nbsp;Eureka 使用&nbsp;为服务消费者整合 Ribbon&nbsp;消费者整合 Feign&nbsp;Hystrix 实现容错&nbsp;配置 Zuul 网关&nbsp;使用 Spring Cloud Config&nbsp;Spring Cloud Sleuth 简介&nbsp;Zipkin 的使用&nbsp;Docker 安装及常用命令&nbsp;Docker 镜像构建&nbsp;Docker Registry 与 Maven 构建镜像&nbsp;Docker Compose 编排文件编写&nbsp;通过 Docker Compose 编排启动微服务详细介绍什么是微服务？它解决了哪些问题？它又具有哪些特征呢？关于一些微服务理论性的内容在网上基本都有了，因此本课程主要讲解如何通过实验的方式实战 Spring Boot/Cloud 并结合 Docker 使用。课程包含了服务注册于发现中心 Eureka、Spring Boot Actuator 监控端点、Ribbon 客户端负载均衡、Feign 声明式 REST 调用、 Hystrix 容错处理、Zuul 网关、Spring Cloud Config 配置管理、Spring Cloud Sleuth 与 Zipkin 结合图形化展示、Docker 与 Docker Compose 的基本使用，最后通过 Dcoker Compose 介绍了接近实际开发的两个例子。本训练营课程共分为 15 个部分。课程首先会介绍一下微服务架构和 Spring Cloud 相关概念。接着就开始基于 Spring Cloud 开始实战编写微服务，从 Eureka 服务注册与发现到后面的 Docker 运行微服务。最后结合 Docker Compose 编排多个 Docekr 容器。课程特色Spring Cloud 是开发分布式系统的「全家桶」，是一系列框架的有序集合。Spring Cloud 利用 Spring Boot 的开发便利性巧妙地简化了分布式系统基础设施的开发。Spring Cloud 对于中小型互联网公司来说是一种福音，使用 Spring Cloud 一站式解决方案能在从容应对业务发展的同时大大减少开发成本。这套 Spring Cloud 入门教程在讲解 Spring Cloud 自身内容的同时也深入分享了一些实战中的问题、解决思路以及扩展内容，适用于 Java 开发人员，特别是对微服务架构感兴趣的开发人员阅读学习。效果展示eurekazipkin适合人群适用于 Java 开发人员，特别是对微服务架构感兴趣的开发人员阅读学习。', '/uploads/20231213/8c0fbf27ffd323638783e1bc409b386b.png', NULL, 129.00, 33, 1702479853, NULL);
INSERT INTO `fa_subject` VALUES (160, 'JavaScript 基础入门', '你将学到的&nbsp;JavaScript 语法基础&nbsp;JavaScript 结构控制&nbsp;JavaScript 函数&nbsp;JavaScript 事件&nbsp;JSON 和 Web API&nbsp;JavaScript 调试&nbsp;JavaScript 值和引用&nbsp;JavaScript 异常处理&nbsp;JavaScript 面向对象编程&nbsp;JavaScript 函数进阶知识详细介绍先学知识需要了解蓝桥云课的基本操作，推荐学习&nbsp;新手入门指南；如果你没有接触过 PHP 编程语言，推荐学习&nbsp;PHP 编程入门。课程难度本课程难度为简单。面向用户本课程为 JavaScript 的入门课程，面向完全没有经验的新手，但推荐先学习 HTML 基础课和 CSS 基础课。', '/uploads/20231213/a1d0cae202ec0d60b6432b10c429ca79.png', NULL, 79.00, 34, 1702480006, NULL);
INSERT INTO `fa_subject` VALUES (161, 'Git 与 GitHub 入门实践', '你将学到的&nbsp;Git 与 GitHub 的来历&nbsp;在 GitHub 上创建仓库&nbsp;安装 Git&nbsp;克隆 GitHub 上的仓库到本地&nbsp;Git 仓库的三大区域&nbsp;添加修改到暂存区以及撤销修改&nbsp;查看提交历史&nbsp;配置个人信息&nbsp;版本回退&nbsp;处理 commit 时间线分叉&nbsp;添加 SSH 关联授权&nbsp;为 Git 命令设置别名&nbsp;创建新的本地分支&nbsp;本地分支跟踪远程分支&nbsp;忽略文件&nbsp;什么是 PR&nbsp;同步主仓库&nbsp;Git 标签的作用详细介绍实验任务熟悉 Git 与 GitHub 的来历，在 GitHub 上创建仓库并克隆仓库到本地完成一次完整的项目修改、提交、推送操作为 Git 命令设置别名，掌握分支管理的六个常用操作创建多人协作仓库，邀请合作者，添加 issue完成任务后推送提交并向主仓库提 PR ，合并 PR 后同步主仓库掌握 Git 标签的作用和基本用法先学知识需要了解蓝桥云课的基本操作，推荐学习&nbsp;新手入门指南。课程难度本课程难度为简单。面向用户本课程为 Git &amp; GitHub 的基本使用入门，面向没有经验的新手，如果你希望快速掌握 GitHub 和 Git 的基本操作，为以后的 IT 技术工作打下良好的基础，本课程是非常好的入门选择。', '/uploads/20231213/dac30ad49d14f97b095d541f66dec9b4.png', NULL, 59.00, 35, 1702480121, NULL);
INSERT INTO `fa_subject` VALUES (162, 'Linux 基础入门', '你将学到的&nbsp;Linux 基本概念&nbsp;Linux 常用命令&nbsp;Linux 用户与权限管理&nbsp;Linux 目录结构与文件操作&nbsp;Linux 环境变量&nbsp;查找文件&nbsp;打包与压缩&nbsp;Linux 文件系统与磁盘管理&nbsp;Linux 上获取帮助&nbsp;Linux Crontab&nbsp;管道与数据流重定向&nbsp;简单的正则表达式&nbsp;Linux 软件安装&nbsp;Linux 进程管理详细介绍实验任务动手实践 Linux 常用命令创建、修改与删除用户及用户组设置文件及目录的权限创建、修改和删除文件及目录设置环境变量查找指定的文件并打包设置任务计划通过管道和重定向执行多条命令安装需要的软件先学知识需要了解蓝桥云课的基本操作，推荐学习&nbsp;新手入门指南。课程难度本课程难度为简单。面向用户本课程为 Linux 的基本使用入门，面向没有经验的新手，如果你希望快速上手 Linux 操作系统，为以后的 IT 技术工作打下良好的基础，本课程是你非常好的入门选择。', '/uploads/20231213/b96f1dec45510d11d31fd4fdca846ffb.png', NULL, 69.00, 36, 1702480254, NULL);
INSERT INTO `fa_subject` VALUES (163, '操作系统及Linux内核', '你将学到的&nbsp;GCC 编译器&nbsp;GDB 调试器&nbsp;进程的并发执行&nbsp;系统调用的应用&nbsp;中断&nbsp;Linux 多线程编程&nbsp;进程同步与互斥&nbsp;死锁的分析方法及各种调试工具&nbsp;链接库的编写&nbsp;Linux内存管理及性能优化&nbsp;Linux文件系统&nbsp;Linux 驱动程序的编写详细介绍实验任务Linux 系统简介基本概念及操作用户及文件权限管理Linux 目录结构及文件基本操作Linux 进程概念用信号量解决生产者—消费者问题Linux 进程管理Linux Shell 实现模拟多进程并发执行查看 Linux 下的中断系统调用实验线程编程-加 1 操作为什么会出错？同步机制之生产者和消费者问题用信号量解决生产者—消费者问题Linux 进程管理Linux 死锁现象及分析方法通过命令和代码初步感受存储管理 -编译和链接-编写自己的链接库 -通过 mmap()深入理解虚拟内存管理和性能优化先学知识需要了解蓝桥云课的基本操作，推荐学习&nbsp;新手入门指南；需要了解 Linux 基本操作，推荐学习&nbsp;Linux 基础入门；需要了解 C 语言，推荐学习&nbsp;C 语言入门教程。课程难度本课程难度适中。面向用户面向有一定 Linux 与 C 编程基础的用户，推荐用户进行实验之前先学习理论课程。', '/uploads/20231213/4d301245112d8c0bad8aafdc771c5cba.png', NULL, 99.00, 36, 1702480319, NULL);
INSERT INTO `fa_subject` VALUES (164, 'Vim 基础入门', '你将学到的&nbsp;Vim 六种基本模式&nbsp;Vim 游标移动&nbsp;Vim 删除文本&nbsp;Vim 保存文档&nbsp;Vim 重复命令&nbsp;Vim 复制粘贴&nbsp;Vim 字符替换&nbsp;Vim 字符查找&nbsp;Vim 撤销操作&nbsp;Vim 多文件编辑&nbsp;Vim 可视模式&nbsp;Vim 视窗操作&nbsp;文档加密&nbsp;Vim 执行外部命令详细介绍社群专享扫码入群，即享【3天标准会员】【130元课程优惠】&nbsp;先学知识需要了解蓝桥云课的基本操作，推荐学习&nbsp;新手入门指南。课程难度本课程难度为简单。面向用户本课程为 Vim 的基本使用入门，面向没有经验的新手，适合所有想要学习编程和想要在蓝桥云课学习的人。', '/uploads/20231213/5de11603bf296962299face59fa02af8.png', NULL, 99.00, 36, 1702480393, NULL);
INSERT INTO `fa_subject` VALUES (165, 'jQuery 基础入门', '你将学到的\\njQuery 语法&nbsp;jQuery 选择器&nbsp;jQuery DOM&nbsp;jQuery 事件&nbsp;jQuery 动画&nbsp;jQuery 操作表单&nbsp;jQuery 操作表格&nbsp;Ajax&nbsp;jQuery 插件详细介绍实验任务jQuery 的定义及语法，并完成一个简单的例子jQuery 选择器的使用：基本选择器、层次选择器、表单选择器等学习 jQuery 中的 DOM 操作学习 jQuery 中的事件和动画的操作jQuery 对表单、表格的操作应用：单行文本框、复选框等Ajax 的相关知识以及 jQuery 中 Ajax 的常用操作学习 jQuery 常用插件：表单验证插件 Validation、Cookie 插件、UI 插件先学知识需要了解蓝桥云课的基本操作，推荐学习&nbsp;新手入门指南；学习课程之前，推荐先学习&nbsp;HTML 基础课程、&nbsp;CSS 基础课程&nbsp;和&nbsp;JavaScript 基础课程。课程难度本课程难度为中等。面向用户本课程为 jQuery 的基本使用入门，面向有一定网页编写基础、想学习 jQuery 框架的同学。', '/uploads/20231213/561275db00bd63afe6e564803ac59e4d.png', '47', 129.00, 34, 1702480487, NULL);
